import React from 'react';
import '../styles/AboutPage.css';

function AboutPage() {
    return (
        <div className="page-content">
            <h2>About us</h2>
            <p>
                Welcome to our recipe app! We aim to share the best recipes from around the world with you.
            </p>
            <p>
                Our goal is to help you find inspiration for making delicious meals at home. Join us and start your culinary journey today!
            </p>
        </div>
    );
}

export default AboutPage;
